text:
Du, Geist der Erde, bist mir näher;
            Schon fühl ich meine Kräfte höher,
            Schon glüh ich wie vom neuen Wein.

Hätt Luzifer so ein Dutzend Prinzen,
            Die sollten ihm schon was vermünzen;
            Am Ende kriegt er eine Kommission.

Doch hab ich jetzt so ziemlich stille Tage;
            Mein Bruder ist Soldat,
            Mein Schwesterchen ist tot.

Ich war bestürzt, mir war das nie geschehn;
Es konnte niemand von mir Übels sagen;
Ach, dacht ich, hat er in deinem Betragen
Was Freches, Unanständiges gesehn,
Daß ihm sogleich die Lust mocht wandeln,
Mit dieser Dirne gradehin zu handeln?

Laß das, mein Kind, du fühlst, ich bin dir gut;
Für die ich liebe, ließ' ich Leib und Blut,
Will niemand sein Gefühl und seine Kirche rauben.

Das ist alles recht schön und gut;
Ohngefähr sagt das der Katechismus auch,
Nur mit ein bißchen andern Worten.

Er sieht immer so spöttisch drein
Und halb ergrimmt;
Man sieht, daß er an nichts keinen Anteil nimmt;
Es steht ihm an der Stirn geschrieben,
Daß er nicht mag eine Seele lieben.

Mein Schwesterlein klein
            Hub auf die Bein
            An einen kühlen Ort;
            Da ward ich ein schönes Waldvögelein;
            Fliege fort!
